@NgModule({
  declarations: [SkyTokenComponent, SkyTokensComponent],
  imports: [
    CommonModule,
    SkyIconModule,
    SkyIndicatorsResourcesModule,
    SkyIdModule,
    SkyScreenReaderLabelDirective,
  ],
  exports: [SkyTokenComponent, SkyTokensComponent],
})

@Component({
  selector: 'sky-tokens',
  templateUrl: './tokens.component.html',
  styleUrls: ['./tokens.component.scss'],
  changeDetection: ChangeDetectionStrategy.OnPush,
  animations: [
    trigger('blockAnimationOnLoad', [transition(':enter', [])]),
    trigger('dismiss', [
      transition(':enter', [
        style({
          opacity: 0,
          width: 0,
        }),
        animate(
          '150ms ease-in',
          style({
            opacity: 1,
            width: '*',
          }),
        ),
      ]),
      transition(':leave', [
        animate(
          '150ms ease-in',
          style({
            opacity: 0,
            width: 0,
          }),
        ),
      ]),
    ]),
  ],
})

@Component({
  standalone: true,
  selector: 'sky-wait',
